	  	  printf("              Interface [%6s]   %08d  %06d             ", IPGlobal::PNAME[6].c_str(), IPGlobal::PKT_RATE_INTF_6, IPGlobal::BW_MBPS_INTF_6);
	  	  printPktStoreStats_i_6();
